	public static class String2Byte {
		public char[] str;
		
		/** byte[]를 char[]로 변환*/
		public String2Byte(byte[] buf, int offset, int len) {
			Wifi.setWifiState(true, "String2Byte start");
			byte[] temp = new byte[2];
			int i;
			str = new char[len/2];
			int count = 0;
			for (i=offset; i<offset+len; i+=2) {
				try {
				temp[0] = buf[i];
				temp[1] = buf[i+1];
				short s = IO.toShort(temp, true);
				str[count] = (char)s;
				count++;
				}catch(Exception e) {
					Wifi.setWifiState(true, e.toString());
				}
			}
		}
		
		/**자바 스트링으로 변환*/
		public String toString() {
			if (str==null) return null;
			return new String(str);
		}
		
		public byte[] toBytes() {
			int i;
			if (str==null) return null;
			byte[] r = new byte[str.length*2];
			
			for (i=0; i<str.length; i++) {
				try {
				byte[] temp;
				short s = (short)str[i];
				temp = IO.toBytes(s, true);
				r[2*i] = temp[0];
				r[2*i+1] = temp[1];
				}catch(Exception e) {
					Wifi.setWifiState(true, e.toString());
				}
			}
			return r;
		}
		
		public static String read(InputStream is) {
			//String text = IO.readString(is);
			byte[] buf = new byte[500];
			Wifi.setWifiState(true, "EditText start reading");
			
			int count=0;
			String r="";
			while (true) {
				try {
					count = is.read(buf, 0, buf.length);
					if (count<0) {
						break;
					}				
					String2Byte str = new String2Byte(buf, 0, count);
					r += str.toString();
					Wifi.setWifiState(true, r);
				} catch (IOException e) {
					// TODO Auto-generated catch block
					Wifi.setWifiState(true, "EditText-read " + e.toString());
					break;
				}
				catch (Exception e) {
					// TODO Auto-generated catch block
					Wifi.setWifiState(true, "EditText-read "+ e.toString());
					break;
				}
			}
			
			//String2Byte msStr = new String2Byte(buf, 0, offset);
			//return msStr.toString();
			return r;
		}
	}
